import React, { Component }  from 'react';
import { PageHeader, Card, Image } from 'antd';
import './index.less'; 


class ProfilePage extends Component {
  constructor(props) {
    super(props);
    this.state = {
    }
  }

  onChange = checked => {
    this.setState({ loading: !checked });
  };

  render() {

    return (
      <div className="profile-page">
        <PageHeader
          className="profile-page-header"
          onBack={() => null}
          title="我的"
          subTitle="Flight Aware Monitoring Platform"
        />
          <Card
            hoverable
            style={{ width: '80%', marginTop: 20, display: 'flex', flexDirection: 'row' }}
          >
            <Image
              width={50}
              height={50}
              style={{margin: 10}}
              src="https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png"
              fallback="data:image/png;base64,"
            />
            <Card.Meta style={{ width: '50%', marginTop: 20 }} title="Europe Street beat" description="www.instagram.com" />
          </Card>
      </div>
    );
  }
}

export default ProfilePage;
